import React from "react";
import Carousel from "../../../components/Carousel";
import CinemaList from "../../../components/CinemaList";
import MovieList from "../../../components/MovieList";

const Home = () => {
  return (
    <>
      <Carousel />
      <MovieList />
      <CinemaList />
    </>
  );
};

export default Home;
